"    <style>
        html, body { 
            margin: 0; 
            padding: 0; 
            width: 100%; 
            height: 100%; 
            overflow: hidden;
        }
        * { 
            box-sizing: border-box; 
        }
        body > *:first-child {
            width: 100% !important;
            height: 100% !important;
            max-width: 100% !important;
            max-height: 100% !important;
        }
    </style>"

"    <script>
    (function() {
        document.addEventListener('click', function(e) {
            e.preventDefault();
            window.webkit.messageHandlers.adClick.postMessage('click');
            return false;
        }, true);
    })();
    </script>"

"    <script>
    (function() {
        // MRAID 2.0 state cache
        var _state = "loading";
        var _isViewable = false;
        var _placementType = "inline";
        var _screenSize = {width: 0, height: 0};
        var _maxSize = {width: 0, height: 0};
        var _currentPosition = {x: 0, y: 0, width: 0, height: 0};
        var _defaultPosition = {x: 0, y: 0, width: 0, height: 0};
        var _expandProperties = {width: 0, height: 0, useCustomClose: false, isModal: true};
        var _resizeProperties = {width: 0, height: 0, offsetX: 0, offsetY: 0, customClosePosition: "top-right", allowOffscreen: true};
        var _orientationProperties = {allowOrientationChange: true, forceOrientation: "none"};
        var _supportedFeatures = {
            sms: false,
            tel: true,
            calendar: false,
            storePicture: false,
            inlineVideo: true
        };
        var _listeners = {};

        window.mraid = {
            VERSION: "2.0",

            // Synchronous getters (MRAID 2.0 requirement)
            getVersion: function() { 
                return "2.0"; 
            },

            getState: function() { 
                return _state;
            },

            getPlacementType: function() { 
                return _placementType;
            },

            isViewable: function() {
                return _isViewable;
            },

            getScreenSize: function() {
                return _screenSize;
            },

            getMaxSize: function() {
                return _maxSize;
            },

            getCurrentPosition: function() {
                return _currentPosition;
            },

            getDefaultPosition: function() {
                return _defaultPosition;
            },

            getExpandProperties: function() {
                return _expandProperties;
            },

            setExpandProperties: function(properties) {
                _expandProperties = Object.assign({}, _expandProperties, properties);
                mraid._sendCommand('setExpandProperties', properties);
            },

            getResizeProperties: function() {
                return _resizeProperties;
            },

            setResizeProperties: function(properties) {
                _resizeProperties = Object.assign({}, _resizeProperties, properties);
                mraid._sendCommand('setResizeProperties', properties);
            },

            getOrientationProperties: function() {
                return _orientationProperties;
            },

            setOrientationProperties: function(properties) {
                _orientationProperties = Object.assign({}, _orientationProperties, properties);
                mraid._sendCommand('setOrientationProperties', properties);
            },

            supports: function(feature) {
                return _supportedFeatures[feature] || false;
            },

            // Commands
            expand: function(url) {
                mraid._sendCommand('expand', {url: url});
            },

            close: function() {
                mraid._sendCommand('close', {});
            },

            open: function(url) {
                mraid._sendCommand('open', {url: url});
            },

            resize: function() {
                mraid._sendCommand('resize', _resizeProperties);
            },

            setUseCustomClose: function(useCustomClose) {
                mraid._sendCommand('setUseCustomClose', {useCustomClose: useCustomClose});
            },

            playVideo: function(url) {
                mraid._sendCommand('playVideo', {url: url});
            },

            storePicture: function(url) {
                mraid._sendCommand('storePicture', {url: url});
            },

            createCalendarEvent: function(parameters) {
                mraid._sendCommand('createCalendarEvent', parameters);
            },

            // Event handling
            addEventListener: function(event, listener) {
                if (!_listeners[event]) {
                    _listeners[event] = [];
                }
                _listeners[event].push(listener);
            },

            removeEventListener: function(event, listener) {
                if (!_listeners[event]) return;
                var idx = _listeners[event].indexOf(listener);
                if (idx !== -1) {
                    _listeners[event].splice(idx, 1);
                }
            },

            // Internal methods
            _sendCommand: function(command, parameters) {
                var message = Object.assign({command: command}, parameters);
                try {
                    webkit.messageHandlers.mraid.postMessage(message);
                } catch (e) {
                    console.log('MRAID: Unable to send command', e);
                }
            },

            _fireEvent: function(event, data) {
                if (!_listeners[event]) return;
                _listeners[event].forEach(function(listener) {
                    try {
                        listener(data);
                    } catch (e) {
                        console.log('MRAID: Error in event listener', e);
                    }
                });
            },

            _nativeSync: function(payload) {
                // Update cached state from native
                if (payload.state && payload.state !== _state) {
                    _state = payload.state;
                    mraid._fireEvent("stateChange", _state);
                }

                if (typeof payload.isViewable === "boolean" && payload.isViewable !== _isViewable) {
                    _isViewable = payload.isViewable;
                    mraid._fireEvent("viewableChange", _isViewable);
                }

                if (payload.screenSize) _screenSize = payload.screenSize;
                if (payload.maxSize) _maxSize = payload.maxSize;
                if (payload.currentPosition) _currentPosition = payload.currentPosition;
                if (payload.defaultPosition) _defaultPosition = payload.defaultPosition;
                if (payload.placementType) _placementType = payload.placementType;
                if (payload.supportedFeatures) _supportedFeatures = payload.supportedFeatures;
            },

            _error: function(message, action) {
                mraid._fireEvent("error", {message: message, action: action});
            },

            fireSizeChange: function(width, height) {
                mraid._fireEvent("sizeChange", {width: width, height: height});
            }
        };
    })();
    </script>"
